import React from 'react';

const Dashboard = () => {
    return(
        <>
        <h1>Dashboard</h1><hr />
        <h1>Tic Tac Toe</h1><hr />
        <div className='container'>
            <button>Single Player</button><hr style={{width:"20px"}} />
            <button>Multi Player</button>
        </div>
        </>
    )
}


export default Dashboard;
